import Layout from '../components/layout'
import Style from '../styles/home/home.module.css'

export default function Home() {
  return (
   <Layout home>
     <div>
      <h1 className={Style.hook}>Homgroon in service</h1>
      <img className={Style.image} src="https://images.unsplash.com/photo-1497515114629-f71d768fd07c?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=2262&q=80" />
     </div>
   </Layout>
  )
}
